import React from "react";
import { UilBars } from "@iconscout/react-unicons";

const NavBar = () => {
  return (
    <div className="Navbar">
      <span className="nav-logo">Welcome to Seeds Cafe</span>
      <div className="nav-items"></div>
      <UilBars />
    </div>
  );
};

export default NavBar;
